Suppose, you only have two Api in api.rs originally, like this: #![allow(unused_variables)] pub fn simple_add(a: i32, b: i32) -> i32 { a + b
} pub fn simple_minus(a: i32, b: i32) -> i32 { a - b
} Now you want to classify these 2 Api into 2 blocks for some reason-- say, you put the simple_add Api into file api_1.rs and the other into api_2.rs. And then make a little modification in lib.rs: mod api_1;
mod api_2; Ok, now the question is how to deal with them with flutter_rust_bridge? From the template justfile , we know code from a single API file called api_rs can be generated with a command like this: gen: export REPO_DIR="$PWD"; cd /; flutter_rust_bridge_codegen {{llvm_path}} \ --rust-input "$REPO_DIR/native/src/api.rs" \ --dart-output "$REPO_DIR/lib/bridge_generated.dart" \
... (For simplicity, only two necessary flags rust-input and dart-output here.) Then, to generate code within 2 blocks(files), you may come out with an approach like this: gen: export REPO_DIR="$PWD"; cd /; flutter_rust_bridge_codegen {{llvm_path}} \ --rust-input "$REPO_DIR/native/src/api_1.rs" \ --dart-output "$REPO_DIR/lib/bridge_generated_api_1.dart" \ export REPO_DIR="$PWD"; cd /; flutter_rust_bridge_codegen {{llvm_path}} \ --rust-input "$REPO_DIR/native/src/api_2.rs" \ --dart-output "$REPO_DIR/lib/bridge_generated_api_2.dart" \
... But here comes a problem, how to use them in dart? Like await API.simpleAdd(1,2) or await API.simpleMinus(1,2) as before? The point here is, to thoroughly decouple Api from different blocks (which is the main reason for using multiple blocks of API), flag class-name is needed . So the command should be modified like this: gen: export REPO_DIR="$PWD"; cd /; flutter_rust_bridge_codegen {{llvm_path}} \ --rust-input "$REPO_DIR/native/src/api_1.rs" \ --dart-output "$REPO_DIR/lib/bridge_generated_api_1.dart" \ --class-name ApiClass1 export REPO_DIR="$PWD"; cd /; flutter_rust_bridge_codegen {{llvm_path}} \ --rust-input "$REPO_DIR/native/src/api_2.rs" \ --dart-output "$REPO_DIR/lib/bridge_generated_api_2.dart" \ --class-name ApiClass2
... (The class name ApiClass1 and ApiClass2 are chosen arbitrarily here.) So now it seems to be perfect to generate code and using Api in Dart like ApiClass1.simpleAdd(1,2) or ApiClass2.simpleMinus(1,2). But actually, the above command is still not enough to generate code correctly. Because multiple blocks need to be translated respectively through FFI. So on the rust side, instead of generating code to a single file bridge_generated.rs , now there are 2 files needed. But, what are the names of these 2 auto-generated rust files? Here, for less misunderstanding, flutter_rust_bridge decides to ask for another compulsory flag rust-output. So the command should be modified like this: gen: export REPO_DIR="$PWD"; cd /; flutter_rust_bridge_codegen {{llvm_path}} \ --rust-input "$REPO_DIR/native/src/api_1.rs" \ --dart-output "$REPO_DIR/lib/bridge_generated_api_1.dart" \ --class-name ApiClass1 \ --rust-output generated_api_1 export REPO_DIR="$PWD"; cd /; flutter_rust_bridge_codegen {{llvm_path}} \ --rust-input "$REPO_DIR/native/src/api_2.rs" \ --dart-output "$REPO_DIR/lib/bridge_generated_api_2.dart" \ --class-name ApiClass2 \ --rust-output generated_api_2
... (Still, the rust output name generated_api_1 and generated_api_2 are chosen arbitrarily here.) That is, flutter_rust_bridge asks you to manually define the generated rust file names, feel free to choose any name you like.

